import React, { useEffect, useRef } from "react";
import ITyped from "react-ityped";
import Yellow from "../../asset/yellow_ellipse.png";

const About = () => {
    const strings = ["Startups", "SMEs"];

    return (
        <div className="relative text-center  mt-20">
            <div
                className="absolute right-0 lg:inline-block "
                style={{ bottom: "-30px" }}
            >
                <img src={Yellow} alt="ellipse" />
            </div>
            <div className="w-40/50 ml-auto mr-auto mt-4">
                <h2>Hello I'm Nwaose victor </h2>
                <h1 className="text-7xl font-sans text-left font-bold">
                    I build visually appealing websites and softwares for
                </h1>
            </div>

            <ITyped
                className="container ityped-cursor"
                showCursor={false}
                strings={strings}
                typeSpeed={500}
                backSpeed={500}
                startDelay={500}
                backDelay={900}
            />
        </div>
    );
};

export default About;
